import React , { useState }from 'react';
import {Typography ,Grid,SvgIcon} from '@mui/material';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import Divider from '@mui/material/Divider';
import AirIcon from '@mui/icons-material/Air';
import FilterDramaIcon from '@mui/icons-material/FilterDrama';
import ThermostatIcon from '@mui/icons-material/Thermostat';
import { ReactComponent as HumidityIcon } from '../../assets/humidity.svg';
import './WeeklyForecast.css';
const style = {
  width: '100%',
  maxWidth: 600,
  bgcolor: 'blue',
  marginTop: '20%',
      justifyContent: 'center',
      alignItems: 'center',
      textAlign: 'center',
      padding: '2px 0 2px',
      background:
        'linear-gradient(0deg, rgba(255, 255, 255, .05) 0%, rgba(171, 203, 222, .05) 100%) 0% 0%',
      boxShadow:
        'rgba(0, 0, 0, 0.05) 0px 10px 15px -3px, rgba(0, 0, 0, 0.05) 0px 4px 6px -2px',
      borderRadius: '8px'
};

const itemstyle ={
  fontSize: { xs: '12px', sm: '16px' },
  fontWeight: { xs: '400', sm: '600' },
  color: 'white',
  fontFamily: 'Poppins',
  lineHeight: 1
};

const subitemstyle={

                alignItems: 'center',
                justifyContent: 'center',
}

const imagefont={
fontSize: { xs: '15px', sm: '16px', md: '18px' } 
}


const WeeklyForecast=({ data }) =>{
return (
  <List sx={style} component="nav" aria-label="mailbox folders">
    <ListItem>
    <Typography
      variant="p"
      component="p"
      sx={itemstyle}>
        <Grid container spacing={{ xs: 2, md: 4}} columns={{ xs: 4, sm: 8, md: 12 }}>
        <Grid item xs={2} sm={4} md={4} sx={subitemstyle}>
          Wednesday
        </Grid>
        <Grid item xs={2} sm={4} md={4} sx={subitemstyle}>
        <div className="flex-container">
    <div className="item">  <ThermostatIcon
      sx={imagefont}
    /> </div>
    <div className="item"> { data[4].temp } Â°c</div>
  </div>
        </Grid>
        <Grid item xs={2} sm={4} md={4} sx={subitemstyle}>
      <div className="flex-container">
    <div className="item">  <AirIcon
      sx={imagefont}
    /> </div>
    <div className="item"> {data[4].wind} M/S</div>
  </div>
        </Grid>
        <Grid item xs={2} sm={4} md={4} sx={subitemstyle}>
          26-06-2023
        </Grid>
        <Grid item xs={2} sm={4} md={4} sx={subitemstyle}>
        <div className="flex-container">
    <div className="item">  <FilterDramaIcon
      sx={imagefont}
    /> </div>
    <div className="item"> {data[4].clouds} %</div>
  </div>
        </Grid>
        <Grid item xs={2} sm={4} md={4} sx={subitemstyle}>
        <div className="flex-container">
    <div className="item">  <SvgIcon
        component={HumidityIcon}
        inheritViewBox
        sx={imagefont}
      /> </div>
    <div className="item"> {data[4].humidity} M/S</div>
  </div>
        </Grid>

    </Grid>
    </Typography>
    </ListItem>
  </List>
);
}

export default WeeklyForecast
